import React, { Component } from 'react'
import "./testimonials.scss"

export class Testimonials extends Component {
    render() {
        return (
            <div className="testimonials" id="testimonials">
                 <h2>Resumo Profissional</h2>
            </div>
        )
    }
}

export default Testimonials
